#Selection Sort Function
#Run time: O(n^2)     |     Best: O(n)
def selectionSort(arr):                                                                                                                                     
    for i in range(len(arr)):                                                                       #Iterate through the array
        small = i                                                                                   #Set the first element as the smallest
        
        for j in range(i, len(arr)):                                                                #Look through all elements
            if arr[j] < arr[small]: small = j                                                       #If a smaller value is found, mark

        (arr[i], arr[small]) = (arr[small], arr[i])                                                 #Swap the smaller value with the current first
    
    return arr                                                                                      #Return sorted array



#Bubble Sort Function
#Run time: O(n^2)     |     Best: O(n)
def bubbleSort(arr):
    for i in range(len(arr)):                                                                       #Iterate through every element in the array
        for j in range(i):                                                                          #Iterate through every element that has been seen
            if arr[i] < arr[j]: (arr[i], arr[j]) = (arr[j], arr[i])                                 #Swap if smaller

    return arr                                                                                      #Return sorted array



#Insertion Sort Function
#Run time: O(n^2)     |     Best: O(n)
def insertionSort(arr):
    for i in range(1, len(arr)):                                                                    #Iterate through each element of the list
        for j in range(0, i):                                                                       #Iterate through each element up to the originals location
            if arr[j] > arr[i]:                                                                     #Check if the value at that location is larger
                temp = arr.pop(i)                                                                   #If it is, we will remove and insert the original value into that place
                arr.insert(j, temp) 
                break                                                                               #Break the loop
    
    return arr                                                                                      #Return sorted array



#Merge Sort Function
#Run time: O(nlog(n))     |     Best: O(nlog(n))
def mergeSort(arr):
    if len(arr) == 1: return arr                                                                    #Base case
    
    left, right, merged = [], [], []                                                                #Initialize lists
    
    left, right = mergeSort(arr[ : int(len(arr) / 2)]), mergeSort(arr[int(len(arr) / 2) : ])        #Recursive call: split left and right halves
    
    while len(left) != 0 and len(right) != 0:                                                       #Merge the two lists together
        merged.append(left.pop(0)) if left[0] < right[0] else merged.append(right.pop(0))           #Take the smallest of which ever is the first element in each list
                                                                                                    #Since the lists are sorted, the smallest elements will always be in the front
    if len(left) != 0 and len(right) == 0:                                                          #Append the rest of the elements from which ever list is not empty
        for i in left: merged.append(i)
    else:
        for i in right: merged.append(i)
    
    return merged                                                                                   #Return sorted sublist



#k-Merge Sort Function
#Run time: O(nlog(k))     |     Best: O(nlog(k))
def kmergeSort(arr, k):
    if len(arr) == 1: return arr                                                                    #Base case

    klists, merged = [], []                                                                         #klists is the way of containing the numbers, rather then left and right
    kVar = k if len(arr) > k else len(arr)                                                          #If there are less elements in the array then the value of 'k', this won't work. Use the smallest

    for i in range(kVar):                                                                           #Make the recursive call for each section
        if i != k - 1: klists.append(kmergeSort(arr[len(arr) // kVar * i : len(arr) // kVar * (i + 1)], k))
        else: klists.append(kmergeSort(arr[len(arr) // kVar * i : ], k))                            #If i is equal to k - 1 -- the last section -- then take the remainder of the values

    while len(klists) != 0:                                                                         #Combine the k lists
        minI, minVal = -1, float('inf')
        
        for i in range(len(klists)):                                                                #Find the smallest values at the start of the lists
            if klists[i] == None or klists[i] == []:                                                #Remove any None arrays or empty arrays
                klists.pop(i)
                minI = -1
                break                                                                               #If something is removed, the indexing will be messed up

            if klists[i][0] < minVal:                                                               #Compare values
                minVal = klists[i][0]
                minI = i
        
        if minI != -1: merged.append(klists[minI].pop(0))                                           #If no break occured, append the smallest value

    return merged                                                                                   #Return sorted list



#TimSort Function(s)
#Run Time: O(nlog(n))     |     Best: O(n)

#getRun function
#Returns the best possible run length for the size of the list
def getRun(n):
    r = 0
    while n >= 64:      #64 is our breaking point. Everything should be 64 or less to make insertion sort efficient
        r |= n & 1      #Bitwise OR opperation
        n >>= 1         #Bitshift everything to the right one
    
    return n + r        #Return the shifted/changed values

#timInsertion function
#Insertion sort part of the TimSort algorithm
def timInsertion(arr, left, right):
    for i in range(left + 1, right):                                #Iterate through the array
        temp = arr[i]                                               #Store the current value
        idxTemp = i - 1

        while idxTemp >= left and arr[idxTemp] > temp:              #Iterate to the left until there is a smaller value
            arr[idxTemp + 1] = arr[idxTemp]
            idxTemp = idxTemp - 1
        
        arr[idxTemp + 1] = temp                                     #Change the value

#timeMerge function
#Function responsible for merging the sorted runs
def timMerge(arr, left, mid, right):
    leftArr, rightArr, idx, idxL, idxR = arr[left : mid], arr[mid: right], left, 0, 0
    
    while idxL < len(leftArr) and idxR < len(rightArr):             #The merge part of merge sort
        if leftArr[idxL] < rightArr[idxR]:
            arr[idx] = leftArr[idxL]
            idxL += 1
        else:
            arr[idx] = rightArr[idxR]
            idxR += 1
        idx += 1

    for i in range(idxL, len(leftArr)):
        arr[idx] = leftArr[i]
        idx += 1
        
    for i in range(idxR, len(rightArr)):
        arr[idx] = rightArr[i]
        idx += 1

#timSort function
#Main function of TimSort
def timSort(arr):
    run = getRun(len(arr))                                                          #Get the run value

    for i in range(0, len(arr), run):                                               #Insertion Sort the runs
        timInsertion(arr, i, i + run if i + run < len(arr) else len(arr))
    
    mergeSize = run                                                                 #Current size of the merge
    while mergeSize < len(arr):                                                     #Once the merge size is the same or larger then the array, we can stop
        for left in range(0, len(arr), mergeSize * 2):                              #Iterate through the array with each merge size
            mid = left + mergeSize
            right = min(len(arr), left + (2 * mergeSize))
            
            if mid < right: timMerge(arr, left, mid, right)                         #Merge call
        
        mergeSize *= 2                                                              #Change merge size

    return arr

